import mc from "./sign-up.module.scss";
import { useDispatch, useSelector } from "react-redux";
import { setItem } from "../../../utils/storage.utils";

const SignUp = ({ onError }) => {
  const dispatch = useDispatch();
  const { user } = useSelector((store) => {
    return { user: store.userReducer };
  });

  const handleInputChange = (e, input) => {
    const action = {
      type: "UPDATE_INPUT",
      payload: {
        value: e.target.value,
        input: input,
      },
    };
    dispatch(action);
  };

  const labelUp = (e, input) => {
    const action = {
      type: "LABEL_TOP",
      payload: {
        input: input,
      },
    };
    dispatch(action);
  };

  const closeLogin = () => {
    const action = {
      type: "CLOSE_LOGIN",
    };
    dispatch(action);
  };

  const openSignIn = () => {
    const action = {
      type: "OPEN_LOGIN",
    };
    dispatch(action);
  };

  const cleanInputValue = (input) => {
    const action = {
      type: "CLEAN_INPUT",
      payload: {
        input: input,
      },
    };
    dispatch(action);
  };

  const isLogged = () => {
    const action = {
      type: "IS_LOGGED",
    };
    dispatch(action);
  };

  const handleSubmit = async (e) => {
    e.preventDefault();
    let result;
    let status;

    const form = {
      pseudo: user.pseudo.value,
      email: user.email.value,
      confirmEmail: user.emailConfirm.value,
      password: user.password.value,
      confirmPassword: user.passwordConfirm.value,
    };

    const config = {
      method: "POST",
      body: JSON.stringify(form),
      headers: {
        "content-type": "application/json; charset=UTF-8",
      },
    };

    try {
      const response = await fetch(
        `http://localhost:7001/users/sign-up`,
        config
      );
      status = response.status;
      result = await response.json();
    } catch (e) {
      console.error(`Problem with request ${e.message}`);
      onError();
      return;
    }

    if (status >= 400) {
      onError(status);
      return;
    }

    cleanInputValue("pseudo");
    cleanInputValue("email");
    cleanInputValue("password");
    cleanInputValue("emailConfirm");
    cleanInputValue("passwordConfirm");

    const token = result.token;
    // window.localStorage.setItem("token", JSON.stringify(token));
    setItem("token", token);
    isLogged();
  };

  return (
    <div className={mc.container}>
      <div className={mc.login_close}>
        <button onClick={closeLogin}>X</button>
      </div>

      <form className={mc.form} onSubmit={(e) => handleSubmit(e)}>
        <div className={mc.title}>
          <p>Inscription</p>
        </div>
        <div className={mc.inputs}>
          <div className={mc.inputs_heading}>
            <div className={mc.inputs_blocks}>
              <label className={user.pseudo.selected ? mc.label_up : {}}>
                Pseudo
              </label>
              <input
                required={true}
                type="text"
                value={user.pseudo.value}
                onChange={(e) => handleInputChange(e, "pseudo")}
                onClick={(e) => labelUp(e, "pseudo")}
              ></input>
            </div>
          </div>
          <div className={mc.inputs_heading}>
            <div className={mc.inputs_blocks}>
              <label className={user.email.selected ? mc.label_up : {}}>
                Email
              </label>
              <input
                required={true}
                type="email"
                value={user.email.value}
                onChange={(e) => handleInputChange(e, "email")}
                onClick={(e) => labelUp(e, "email")}
              ></input>
            </div>
            <div className={mc.inputs_blocks}>
              <label className={user.emailConfirm.selected ? mc.label_up : {}}>
                Confirm Email
              </label>
              <input
                required={true}
                type="email"
                value={user.emailConfirm.value}
                onChange={(e) => handleInputChange(e, "emailConfirm")}
                onClick={(e) => labelUp(e, "emailConfirm")}
              ></input>
            </div>
          </div>

          <div className={mc.inputs_heading}>
            <div className={mc.inputs_blocks}>
              <label className={user.password.selected ? mc.label_up : {}}>
                Password
              </label>
              <input
                required={true}
                type="password"
                value={user.password.value}
                onChange={(e) => handleInputChange(e, "password")}
                onClick={(e) => labelUp(e, "password")}
              ></input>
            </div>

            <div className={mc.inputs_blocks}>
              <label
                className={user.passwordConfirm.selected ? mc.label_up : {}}
              >
                Confirm Password
              </label>
              <input
                required={true}
                type="password"
                value={user.passwordConfirm.value}
                onChange={(e) => handleInputChange(e, "passwordConfirm")}
                onClick={(e) => labelUp(e, "passwordConfirm")}
              ></input>
            </div>
          </div>
        </div>
        <div className={mc.connect}>
          <button type="submit" onClick={(e) => handleSubmit(e)}>
            S'incrire
          </button>
          <span onClick={openSignIn}>Déjà client ?</span>
        </div>
      </form>
    </div>
  );
};

export default SignUp;
